column8:
米軍放出品のSpecialty Defense Systems製 MOLLEスタイル9mmピストルマガジンポーチです。<br><br>

ピストルマガジンを1本を収納する事ができるフラップ開閉タイプのポーチです。マガジンの他にマルチツール等を収納できるサイズです。<br><br>

取り付けはMOLLEウェビング方式でベストはもちろんレッグパネルやバックパック等のウェビング対応品ならどこにでもしっかりと取り付ける事が出来ます。下部にはドレインホール（水抜き穴）装備されています。<br><br>

・コンディション：未使用品<br>
・カラー：コヨーテ<br>
・サイズ：約15.5cm×7cm<br>
・原産国：アメリカ<br><br>

<font color="FF0000">※未使用品ですがストック状態によりキズやヨゴレがあるものもございます、予めご了承ください。</font><br><br><style>

/* あす楽ウインドウの調節 */
#rakutenLimitedId_aroundCart #asurakuTable td {
background: #FEFEFE !important;
padding: 2px!important;
font-size: 12px !important;
color: #000000 !important;
}

#rakutenLimitedId_aroundCart #asurakuTable th {
width:500px;
font-size: 12px !important;
}

/* お買い物かごボタンの大きさ */
td > input {
font-size: 25px;
color:#FFF;
background-color: #EA4941;
padding:10px 30px;
margin:10px;
border-style: none;
width: auto;
}

/* 個数入力 */
input#units {
padding: 0px 0px;
background-color: #FFF;
color: #000;
border-style: solid;
}

span.unit{
font-size:100%;
}

/* 「商品についての問い合わせ」ボタンの大きさ*/
font input {
font-size: 12px;
padding:2px;
width: 150px;
}

/* リンク透過 */
