米軍放出品のM249 SAW（支援火器）の200連ボックスマガジンを収納するためのポーチです。<br><br>

バックルでしっかりとフラップを閉じる事が出来るので、マガジンだけではなく多目的ポーチとしても使用できます。<br>
取り付けはMOLLEウェビング方式でベストはもちろんレッグパネルやバックパック等のウェビング対応品ならどこにでもしっかりと取り付ける事が出来ます。<br><br>

使用済みのマガジンを入れるダンプポーチとしてもオススメですよ。<br><br>

・コンディション：未使用品<br>
・カラー：コヨーテブラウン<br>
・バックルカラー：ブラック<br>
・サイズ：約22cm×17.5cm×6cm<br>
・原産国：アメリカ<br><br>

<font color="FF0000">
※米軍のコントラクトナンバー無し<br>
