コンドル・アウトドア社のMOLLE対応チェストリグです。<br><br>

パネル全面にMOLLEウェビング縫い付けられているので、お好みのポーチを取り付けて使用することが可能です。<br><br>

パネルの中心部はマップポーチとしても使用ができるベルクロ開閉式のポケット付きで、両サイドには5．56mmのマガジンを１本ずつ収納することができるオープントップマガジンポーチが２個付属、パネルの裏側にメッシュポケットが配置されています。<br><br>

・品番：MCR4-008<br>
・サイズ：フリーサイズ<br>
・パネルサイズ：約54cm×21cm<br>
・マップポーチサイズ：約19cm×20cm<br>
・素材：ナイロン<br>
・原産国：中国<br><br>

