コンドル・アウトドア社のダブルカンガルーマグポーチです。<br>
オープントップスタイルのM4マガジンポーチとピストルマガジンポーチが一緒になったポーチです。<br>

MOLLEスタイルのベストやボディーアーマーなどに取り付け可能です。<br><br>


・品番：MA51<br>
・カラー：マルチカム<br>
・収納マガジン<br>
M4マガジン×2本収納可能<br>
ピストルマガジン×2本収納可能<br>
・素材： ナイロン<br>
・原産国：中国<br><br>

